import { createSlice } from "@reduxjs/toolkit";


const fetchProducts = as()

const initialState = {
  cartItems: [],
  amount: 0,
  total: 0,
  isLoadingCart: true,
};

const cartSlice = createSlice({
  name: "cart",
  initialState,
  reducers: {},
});

export default cartSlice.reducer;
